import './App.css';
import { Routes, Route } from "react-router-dom";
import { Home } from "./pages/Home/Home.js";
import { Getjoke } from "/pages/Getjoke/Getjoke.js"

function App() {
  return (
      <div className="App">
          <Routes>
              <Route path="/" element={<Home />} exact />
              <Route path="/Getjoke" element={<Getjoke />} exact />
          </Routes>
      </div>
  );
}
export default App;
